import React from "react";
import "../stylesheets/style.css";
import pokeball from "../image/pngwing.com (1).png";

const Pokemon = (props) => {
  const renderTypes = () => {
    return props.type.map((kind) => {
      return <li key={toString()}>{kind}</li>;
    });
  };
  return (
    <>
      <div className="divClass">
        <div>
          <ul className="pokeList">
            <li>
              <img className="pokeImg" src={props.src} />
            </li>
          </ul>

          <ul className="pokeList">
            <li>
              <h1 className="pokeName"> {props.name} </h1>
            </li>
          </ul>
          <ul className="pokeList">
            <li>{renderTypes()} </li>
          </ul>
          <img className="pokeball" src={pokeball} />
        </div>
      </div>
    </>
  );
};

export default Pokemon;
